import React, { useState } from 'react';
import { Formik, Form, Field } from 'formik';
import TextField from '@mui/material/TextField';
import Autocomplete from '@mui/material/Autocomplete';
import Radio from '@mui/material/Radio';
import RadioGroup from '@mui/material/RadioGroup';
import FormControlLabel from '@mui/material/FormControlLabel';
import FormControl from '@mui/material/FormControl';
import FormLabel from '@mui/material/FormLabel';
import OutlinedInput from '@mui/material/OutlinedInput';
import InputLabel from '@mui/material/InputLabel';
import MenuItem from '@mui/material/MenuItem';
import ListItemText from '@mui/material/ListItemText';
import Select from '@mui/material/Select';
import Checkbox from '@mui/material/Checkbox';
import Button from '@mui/material/Button';

// Multi-Select
const ITEM_HEIGHT = 48;
const ITEM_PADDING_TOP = 8;
const MenuProps = {
    PaperProps: {
        style: {
            maxHeight: ITEM_HEIGHT * 4.5 + ITEM_PADDING_TOP,
            width: 250,
        },
    },
};

const names = [
    'Writing',
    'Marketing',
    'Blogging',
    'Learning languages',
    'Photography',
    'Travel',
    'Sports',
    'Yoga',
    'Dance',
];

// DropeDown
const country = [
    { label: 'India' },
    { label: 'US' },
    { label: 'UK' },
    { label: 'Canada' },
    { label: 'China' },
];

const Input = () => {
    const [personName, setPersonName] = useState([]);

    const handleChange = (event) => {
        const {
            target: { value },
        } = event;
        setPersonName(typeof value === 'string' ? value.split(',') : value);
    };

    const initialValues = {
        name: '',
        country: '',
        hobbiesInterests: '',
        gender: '',
        address: '',
    };

    const handleSubmit = (values, props) => {
        console.log(values);
        alert(values.name,values.address)
    };

    return (
        <div className="Container">
            <Formik initialValues={initialValues} onSubmit={handleSubmit}>
                {(props) => (
                    <Form>
                        {/* username */}
                        <Field
                            as={TextField}
                            name="name"
                            id="outlined-basic"
                            label="User's name"
                            variant="outlined"
                            fullWidth
                        />

                        {/* Country */}
                        <Autocomplete
                            fullWidth
                            id="combo-box-demo"
                            options={country}
                            renderInput={(params) => (
                                <Field as={TextField} {...params} name="country" label="Country" />
                            )}
                        />

                        {/* Hobbies and Interests */}
                        <FormControl fullWidth>
                            <InputLabel id="demo-multiple-checkbox-label">Hobbies & Interests</InputLabel>
                            <Field
                                as={Select}
                                name="hobbiesInterests"
                                labelId="demo-multiple-checkbox-label"
                                id="demo-multiple-checkbox"
                                multiple
                                value={personName}
                                onChange={handleChange}
                                input={<OutlinedInput label="Hobbies and Interests" />}
                                renderValue={(selected) => selected.join(', ')}
                                MenuProps={MenuProps}
                            >
                                {names.map((name) => (
                                    <MenuItem key={name} value={name}>
                                        <Checkbox checked={personName.indexOf(name) > -1} />
                                        <ListItemText primary={name} />
                                    </MenuItem>
                                ))}
                            </Field>
                        </FormControl>
                        <br />

                        {/* Gender */}
                        <FormLabel id="demo-row-radio-buttons-group-label">Gender</FormLabel>
                        <Field
                            as={RadioGroup}
                            row
                            aria-labelledby="demo-row-radio-buttons-group-label"
                            name="gender"
                        >
                            <FormControlLabel value="female" control={<Radio />} label="Female" />
                            <FormControlLabel value="male" control={<Radio />} label="Male" />
                            <FormControlLabel value="other" control={<Radio />} label="Other" />
                        </Field>
                        <br />

                        {/* Address */}
                        <Field
                            as={TextField}
                            fullWidth
                            name="address"
                            id="outlined-multiline-static"
                            label="Address"
                            multiline
                            rows={4}
                            defaultValue=""
                        />

                        <Button type="submit" variant="contained">
                            Submit
                        </Button>
                    </Form>
                )}
            </Formik>
        </div>
    );
};

export default Input;
